class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            todos: todoData,
        }; 
    }
    render() {
        const todoList = this.state.todos.map(task => <TodoItem key={task.id} data={task}/>);

        return (
            <div>
                <Header />
                <div className="bkgrnd">
                    <div className="task-list">
                        {todoList}
                    </div>
                </div>
            </div>
        )
    }
}

export default App;
